class svt_chi_protocol_common extends svt_chi_common;

  /** Configuration of this node */
  protected svt_chi_node_configuration cfg;

  /** Configuration of this node */
  svt_chi_node_configuration cfg_snapshot;
  //----------------------------------------------------------------------------
  // Type Definitions
  //----------------------------------------------------------------------------

  //----------------------------------------------------------------------------
  // Public Data Properties
  //----------------------------------------------------------------------------

  /**
   * Protocol svt_err_check instance for layer wide checks.
   */
  svt_chi_protocol_err_check prot_err_check;

 /**
  * Shared status object which allows components (which each reference the same object)
  * to communicate state changes.
  */
  svt_chi_status shared_status;

  svt_chi_system_status shared_system_status;

`ifndef SVT_EXCLUDE_VCAP
 /** Handle to the FIFO rate control class for WRITE xacts */
 svt_chi_fifo_rate_control write_xact_fifo_rate_control;

 /** Handle to the FIFO rate control class for READ xacts*/
 svt_chi_fifo_rate_control read_xact_fifo_rate_control; 

 /** FIFO rate control configuration for READ xacts*/
 svt_fifo_rate_control_configuration read_xact_fifo_rate_control_config; 

 /** FIFO rate control configuration for WRITE xacts*/
 svt_fifo_rate_control_configuration write_xact_fifo_rate_control_config; 
`endif

  //-----------------------------------------
  svt_chi_node_perf_status perf_status;
  svt_chi_node_pmu pmu;
  bit is_pmu_enabled = 0;

  /** Triggered when a new READ transaction is started */
  event new_read_transaction_started;
 
  /** Triggered when a new transaction is started */
  event new_write_transaction_started;
  
  /** Triggered when a READ element is deleted from active xact queue */
  event active_read_xact_queue_empty;
  /** Triggered when a WRITE element is deleted from active xact queue */
  event active_write_xact_queue_empty;  
  //-----------------------------------------
  
  /** The latest flit received on the response VC */
  protected svt_chi_flit curr_resp_flit;

  /** The latest flit received on the request VC */
  protected svt_chi_flit curr_req_flit;

  /** The latest flit coresponding to misc responses such as COMPACK 
    * received on the response VC */
  protected svt_chi_flit curr_misc_resp_flit;

  /** The last flit received on SNP VC */
  protected svt_chi_flit curr_snp_flit;
  
`ifndef SVT_EXCLUDE_VCAP
  /** The current fill level of the READ FIFO */
  protected int global_read_fifo_curr_fill_level = 0;

  /** The current fill level of the WRITE FIFO */
  protected int global_write_fifo_curr_fill_level = 0;

  /** The total number of bytes of all active write transactions in the queue */
  protected int global_total_expected_write_fill_level = 0;

  /** The total number of bytes of all active read transactions in the queue */
  protected int global_total_expected_read_fill_level = 0;
`endif

  /** Number of active read transactions */
  int active_read_xact_count = 0;

  /** Number of active write transactions */
  int active_write_xact_count = 0;

  /** Number of active control transactions */
  int active_control_xact_count = 0;

  /** Number of entries in retry_xacts[] that represent cancelled transactions
    * When #use_active_xact_in_retry_xacts_index is set, indices 0 to 'active_xact_in_retry_xacts_index-1'
    * represent the cancelled transactions
    */
  int active_xact_in_retry_xacts_index = 0;

  /** Bit that determines if the value stored in active_xact_in_retry_xacts_index should be considered. 
    * - Set to 1 when the number of cancelled transactions (PCrdReturn) is equal to the size of the retry_xacts[]
    * - Set to 0 when a PCrdReturn is received but the size of retry_xacts[] is greater than the number of PCRdReturn,
    *   because in this case it is not possible to determine which retry transaction was cancelled 
    * .
    */
  int use_active_xact_in_retry_xacts_index = 1;

  /** Semaphore to control access to txsactive */
  semaphore txsactive_sema;
  
  /** Semaphore to control access to active_xact_queue */
  semaphore active_xact_queue_sema;

  /** Semaphore to control updates to the counters defined in the protocol status object */
  semaphore outstanding_xact_counter_sema;
 
  /** Semaphore to control access to active_snp_xact_queue */
  semaphore active_snp_xact_queue_sema;

  /** Semaphore to control access to temp_snp_dvmop_xact_queue */
  semaphore temp_snp_dvmop_xact_queue_sema;

  /** variable to update object_num of newly created transaction */
  int object_num_tracker, snp_object_num_tracker;

  /** Semaphore that controls object_num_tracker updates */
  semaphore object_num_tracker_sema;
  
  //----------------------------------------------------------------------------
  // Protected Data Properties
  //----------------------------------------------------------------------------

 /** VMM Notify Object passed from the driver */ 
`ifdef SVT_VMM_TECHNOLOGY
  protected vmm_notify notify;
`endif

  /** The latest flit received on the DAT VC for read transactions*/
  protected svt_chi_flit curr_read_data_flit;

  /** The latest flit received on the DAT VC for write transactions*/
  protected svt_chi_flit curr_write_data_flit;

  /** Queue of active transactions */
  svt_chi_transaction active_xact_queue[$];

  /** Queue of active snoop transactions */
  svt_chi_rn_snoop_transaction active_snp_xact_queue[$];

  /** Queue of temporary snoop dvmop transactions */
  svt_chi_rn_snoop_transaction temp_snp_dvmop_xact_queue[$];  

  /** Queue of transactions that got a RETRY response, but havne't yet been retried */
  svt_chi_transaction retry_xacts[$];

  /** Semaphore to control access to retry_xacts queue */
  semaphore retry_xacts_sema;

  /** Queue to track in use txn_id */
  bit in_use_txn_id[0:((1<<`SVT_CHI_TXN_ID_WIDTH)-1)] = '{(1<<`SVT_CHI_TXN_ID_WIDTH){'b0}};
  
  /** Semaphore to control in_use_txn_id*/
  semaphore in_use_txn_id_sema;

  /** To track the number to p_crd_return transaction count*/
  int num_p_crd_return_count = 0;

  /** Semaphore to control access to num_p_crd_return_count*/
  semaphore p_crd_return_count_sema;

  /**
   * Associated array that is used to track P-credits and retries at protocol layer.
   * - first dimension: Indexed with p-credit type
   * - second dimension:
   *   - RN: Indexed with tgt_id
   *   - SN: Indexed with src_id
   *   .
   * - second dimension:
   *   - RN: Indexed with src_id
   *   - SN: Indexed with tgt_id
   *   .
   * .
   */
  int unsigned p_crd_type_tracker [svt_chi_common_transaction::p_crd_type_enum][int][int];

  /** Semaphore to control access to p_crd_type*_tracker arrays */
  semaphore p_crd_type_tracker_sema;

  /** Flag that indicates if receiving DVMSync request is valid */
  bit       is_dvm_sync_req_expected;
  
  /** Semaphore to control access to above flag */
  semaphore dvm_sync_req_sema;

  /** Flag that indicates if receiving barrier request is valid */
  bit       is_barrier_req_expected;

   /** clock period */ 
  protected real clock_period = -1;

  /** Stores the last sample time. Used for calculating clock period */
  protected real last_sample_time = -1;

  int report_new_clock_period = -1;
 
  /** Semaphore to control access to above flag */
  semaphore barrier_req_sema;
`protected
