  /** Mailbox in which RX response flits are put */ 
  mailbox#(svt_chi_flit) rx_rsp_flit_mailbox;

  /** Mailbox in which RX request flits are put */ 
  mailbox#(svt_chi_flit) rx_req_flit_mailbox;

