  mailbox#(svt_chi_flit) rx_snp_flit_mailbox;

  mailbox#(svt_chi_rn_snoop_transaction) snp_req_resp_mailbox; 

  /** expected exclusive read response */
  svt_chi_transaction::resp_err_status_enum expected_excl_rresp[*];

  /** expected exclusive write response */
  svt_chi_transaction::resp_err_status_enum expected_excl_wresp[*];

  /** flag for received exclusive read transaction error */
  protected bit excl_read_error;

  /** flag for received exclusive write transaction error */
  protected bit excl_write_error;


  /** Internal queue to buffer the incomming non-coherent exclusive read transactions */
  svt_chi_transaction exclusive_read_queue[$];

  /** Internal queue to buffer the current exclusive read due to reset of 
    * address by incoming exclusive read transactions */
  svt_chi_transaction exclusive_read_reset_queue[$];

  /** It sets LPID to 1 if exclusive access at any monitored read location
    * is failed due to current normal write transaction to same address */
  protected bit excl_fail[bit[(`SVT_CHI_MAX_TAGGED_ADDR_WIDTH + `SVT_CHI_MAX_LPID_WIDTH)-1 : 0]];

  /** * It sets LPID to 1 when matching exclusive write transaction has been received */ 
  protected bit matching_excl_wr_id[*];

  /** Semaphore that controls access of exclusive_read_queue during read
   * operation. */
  protected semaphore exclusive_read_sema;

  /** Semaphore that controls access of exclusive_read_queue during write
   * operation. */
  protected semaphore exclusive_write_sema;
   
  /** Timer used to track exclusive write transaction followed by exclusive read */
  svt_timer excl_read_write_timer[*];

  /** RN exclusive monitor that monitors the snoop transactions corresponding to store transaction from other RNs */  
  protected bit excl_mon[longint];

  /** Flag to avoid same exclusive transaction getting processed again */
  protected bit excl_xact_processed [svt_chi_transaction];

  /** Semaphore that controls access to RN exclusive monitor */
  protected semaphore excl_mon_sem;
  
  /** Semaphore that controls the processing of coherent exclusive transaction one at a time */
  protected semaphore excl_access_sem;
