  /** Method that invokes the transaction_ended cb_exec method */
  extern virtual task invoke_transaction_ended_cb_exec(svt_chi_common_transaction xact);

  /** Updates the interface outstanding transaction counters in svt_chi_protocol_status handle in the shared status object for the input transaction */
  extern task update_if_outstanding_xact_counters(svt_chi_transaction xact, bit is_xact_driven_on_interface);

  /** Updates the interface outstanding dvm snoop transaction counters in svt_chi_protocol_status handle in the shared status object for the input transaction */
  extern task update_if_outstanding_dvm_snoop_xact_counters(svt_chi_snoop_transaction snoop_xact, bit is_xact_driven_on_interface);

  /** Updates the interface outstanding snoop transaction counters in svt_chi_protocol_status handle in the shared status object for the input transaction */
  extern task update_if_outstanding_snoop_xact_counters(svt_chi_snoop_transaction snoop_xact, bit is_xact_driven_on_interface);

  /**
   * calls out the respective tasks to update outstanding interface xact counters
   * called in svt_chi_node_protocol_monitor after the transactin_observed coverage callback for decermenting outstanding counters
   * called out in invoke_transaction_started_cb for incrementing the outstanding counters
   */
  extern task update_if_outstanding_counters(svt_chi_common_transaction common_xact, bit is_xact_driven_on_interface);
  
  /** Assigns the current and final state properties in the transaction based on 
    * contents of cache and state_type
    */
  extern virtual task assign_cache_state_to_xact(svt_chi_common_transaction xact, string state_type);

  /** Check if this is a valid SNP flit */
  extern virtual function bit is_valid_snp_flit(svt_chi_flit flit, output string reason_str);

  /** Check if this is a valid DAT flit */
  extern virtual function bit is_valid_dat_flit(svt_chi_flit flit, svt_chi_common_transaction common_xact);

  /** Check if this is a valid RSP flit */
  extern virtual function bit is_valid_rsp_flit(svt_chi_flit flit, svt_chi_common_transaction common_xact);

  /** Perform resp_err and resp field check for associated response and data packets*/
  extern function void perform_resp_err_and_resp_field_check(svt_chi_flit flit, svt_chi_common_transaction common_xact);

  /** Perform same dbid across all the read dat flits check */
  extern function void perform_same_dbid_in_read_data_flits_check(svt_chi_flit flit, svt_chi_common_transaction common_xact);

  /** Perform the DBID check */
  extern virtual function void perform_dbid_check(svt_chi_common_transaction cmn_xact, svt_chi_flit flit);

  `ifdef SVT_CHI_ISSUE_B_ENABLE
  /** Perform checks on the DBID field in Snoop responses that have DataPull asserted */
  extern function void perform_data_pull_snoop_response_checks(svt_chi_flit flit, svt_chi_snoop_transaction snp_xact);
  `endif

  /** Perform the DataId check */
  extern virtual function void perform_dataid_check(svt_chi_common_transaction xact, svt_chi_flit flit, bit is_snp_xact, bit is_dvm_xact, string xact_prefix, int num_dat_flits);
  
  /** Randomizes only delay properties of flit */
  extern virtual function void randomize_flit_delay(svt_chi_common_transaction xact,int flit_num = 0,ref svt_chi_flit flit);

  /** Drives debug ports */
  extern virtual task drive_debug_port(svt_chi_common_transaction xact, string vc_id);

  `ifdef SVT_CHI_ISSUE_B_ENABLE
    //Set the is_dct_used flag for Fwd type Snoops based on the initial cache state to indicate if
    //DCT flow is expected to be exercised
    extern virtual task set_dct_used_flag(svt_chi_snoop_transaction snp_xact);
  `endif

  /** Indicates if this is valid post barrier transaction */
  extern virtual function bit is_valid_to_start_post_barrier(svt_chi_transaction ref_xact, svt_chi_transaction cur_xact);

  /** Updates the outstanding transaction counters in svt_chi_protocol_status handle in the shared status object for the input transaction */
  extern task update_outstanding_xact_counters(svt_chi_transaction xact, bit is_xact_added_to_active_queue);

  /** Trigger xact started events for pmu */
  extern function void invoke_xact_started_events(svt_chi_transaction xact);

  /** Trigger xact queue empty events for pmu */
  extern function void trigger_xact_queue_empty_events(svt_chi_transaction xact);
  extern function int get_num_started_xacts(svt_chi_transaction::xact_category_enum xact_category);
    /** Sets the clock period */
  extern function void set_clock_period();
  
  /** Tracks transaction inactivity */
  extern virtual task track_transaction_inactivity_timeout(svt_chi_common_transaction common_xact);

  /** Waits until the transaction ends */
  extern virtual task wait_for_transaction_ended(svt_chi_common_transaction common_xact);

  /** Creates the transaction inactivity timer */
  extern virtual function svt_timer create_xact_inactivity_timer();

  // -----------------------------------------------------------------------------
  //                                EXCLUSIVE PROCESSING BEGIN
  // -----------------------------------------------------------------------------
  /** It returns 1 if there are pending exclusive read transactions in
   * exclusive_read_queue for which matching exclusive write has not come
   * */
  extern virtual function bit pending_exclusive_access_transactions();

  /** It checks the transaction with the same LPID stored in the queue */
  extern virtual function void check_exclusive_same_lpid(svt_chi_transaction xact);

  /** returns a single unique number from xact LPID and ADDRESS */
  extern function bit[(`SVT_CHI_MAX_TAGGED_ADDR_WIDTH + `SVT_CHI_MAX_LPID_WIDTH)-1 : 0] get_uniq_num_from_lpid_addr(svt_chi_transaction xact);

    /** Pushes the transaction into exclusive read queue after all the data beats
    * of exclusive read transaction is received
    */
  extern virtual function void push_exclusive_read_transactions(svt_chi_transaction xact, string kind="");

  /** function that compares the expected and configured READ RESP for exclusive
   * read transactions */
  extern virtual function void perform_exclusive_read_resp_checks(svt_chi_transaction excl_resp_xact);

  /** It returns 1 if transaction with write_lpid = read_lpid exist in the exclusive_read_queue queue */
  extern virtual function bit get_exclusive_read_index(svt_chi_transaction xact, output int ex_rd_idx);

  /** It monitors memory location for exclusive access */
  extern virtual function void check_exclusive_memory(svt_chi_transaction current_xact);
  
  /** It monitors the response for exclusive write transaction */
  //extern virtual function void process_exclusive_write_response(svt_chi_transaction excl_resp_xact, input bit excl_write_error);
  extern virtual function void process_exclusive_write_response(svt_chi_transaction excl_resp_xact, input bit excl_write_error, string kind="");

   /* returns address part of the unique address-id combinatorial number */
  extern function bit[`SVT_CHI_MAX_TAGGED_ADDR_WIDTH -1 : 0] get_addr_from_num(bit[(`SVT_CHI_MAX_TAGGED_ADDR_WIDTH + `SVT_CHI_MAX_LPID_WIDTH)-1 : 0] num);

  /* returns lpid part of the unique address-lpid combinatorial number */
  extern function bit[`SVT_CHI_MAX_LPID_WIDTH-1 : 0] get_lpid_from_num(bit[(`SVT_CHI_MAX_TAGGED_ADDR_WIDTH + `SVT_CHI_MAX_LPID_WIDTH)-1 : 0] num);

  /**Checks for exclusive read transaction and pushes the transaction into exclusive read queue */
  extern virtual function void check_exclusive_read_transactions(svt_chi_transaction xact);

  /**Checks for exclusive write transaction and compares the transaction from exclusive read queue */
  extern virtual function void check_exclusive_write_transactions(svt_chi_transaction xact);

  /** Checks the recevied snoop addr in RN exclusive monitor and resets it if there is an entry */ 
  extern virtual task check_snoop_addr_in_exclusive_monitor(svt_chi_rn_snoop_transaction xact);

  /** Checks the recevied non-exclusive store addr in RN exclusive monitor and resets it if there is an entry */ 
  extern virtual task check_non_exclusive_write_addr_in_exclusive_monitor(svt_chi_transaction xact);
  // -----------------------------------------------------------------------------
  //                     EXTERNAL PROTOCOL NODE MONITOR
  // -----------------------------------------------------------------------------
  /** Pushes external coherent transaction to the port monitor */
  extern virtual task push_external_chi_xact(svt_chi_transaction xact);

  /** Pushes external snoop transaction to the port monitor */
  extern virtual task push_external_chi_snoop_xact(svt_chi_snoop_transaction xact);
 
  // -----------------------------------------------------------------------------
  //                                DMT
  // -----------------------------------------------------------------------------

`ifdef SVT_CHI_ISSUE_B_ENABLE
  extern task perform_dmt_validity_check_for_sn (svt_chi_flit req_flit);
  extern task perform_dmt_validity_check_for_rn (svt_chi_transaction xact, svt_chi_flit data_flit);
`endif

`ifdef SVT_CHI_ISSUE_E_ENABLE
  extern function void check_for_overlapping_makereadunique_xacts(svt_chi_snoop_transaction snp_xact);
  extern task check_for_ongoing_exclusive_transactions(svt_chi_snoop_transaction snp_xact);
  extern task perform_dwt_validity_check_for_sn (svt_chi_flit req_flit);
  extern task perform_dwt_validity_check_for_rn (svt_chi_transaction xact);
`endif
 
  extern virtual function void set_shared_system_status(svt_chi_system_status _shared_system_status);

  /** Identify and end cancelled transactions, called during extract_phase */
  extern virtual function void identify_and_end_cancelled_xacts();

 /** This is a empty virtual function declared in this class. It is defined only in svt_chi_rn_protocol_active_common class.
  * This function performs check on read transactions when the initial cache state was UCE
  */
  extern virtual function void perform_check_on_read_xact_with_uce_initial_state(svt_chi_transaction xact);

endclass

